import React from "react";
import "./Navigation.css"
import logo from "../Assets/logo.png"


export const Navigation = () => {
  return (
    <>
      <div className="navHeader">
        <div className="navLogo">
            <img className="navLogo-img" src={logo} alt=""/>
        </div>

        <ul className="userlist">
            <li className="homelist"><a className="a" href='#'>HOME</a></li>
            <li className="homelist"><a className="a" href='#'>SHOP</a></li>
            <li className="homelist" ><a className="a" href='#'>CATEGORY</a></li>
            <li className="homelist"><a className="a" href='#'>ABOUT US</a></li>
            <li className="homelist"><a className="a" href='#'>CONTACT US</a></li>

        </ul>
      </div>
    </>
  );
};
